"Įjungus „Wi-Fi+“, bus vertinamas jūsų „Wi-Fi“ tinklo ryšys, kad būtų galima teikti išmaniojo tinklų perjungimo funkciją (gali padidėti „Wi-Fi“ duomenų sunaudojimas). „Wi-Fi+“ automatiškai:
