"Įjungus „Wi-Fi+“, bus vertinamas jūsų „Wi-Fi“ tinklo ryšys, kad būtų galima teikti išmaniojo tinklų perjungimo funkciją (gali padidėti „Wi-Fi“ duomenų sąnaudos). „Wi-Fi+“ automatiškai:
1) persijungia tarp „Wi-Fi“ ir mobilių duomenų, kad sklandžiai naršytumėte internetą;
2) įjungia „Wi-Fi“ ryšį, kai šalia veikia žinomas „Wi-Fi“ tinklas, ir prisijungia prie to tinklo;
3) įvertina pasiekiamus „Wi-Fi“ tinklus. Įrenginys automatiškai neprisijungia prie įrašytų tinklų, neturinčių interneto ryšio."

"Įjungus funkciją „Wi-Fi+“, jūsų „Wi-Fi“ bus įvertintas iš naujo, kad būtų galima teikti išmaniojo tinklų perjungimo paslaugas. Kartu „Wi-Fi“ ryšiu bus automatiškai atnaujinti optimizavimo parametrai (gali padidėti „Wi-Fi“ ryšiu perduodamų duomenų apimtis). „Wi-Fi+“ automatiškai:
1) persijungia tarp „Wi-Fi“ ir mobiliojo ryšio duomenų tinklų (galite pasirinkti numatytąjį perjungimo režimą mobiliojo tinklo nustatymuose), kad būtų galima sklandžiai naudotis internetu;
2) įjungia „Wi-Fi“ ryšį, kai aptinkamas žinomas „Wi-Fi“ tinklas, ir prie jo prisijungia;
3) įvertina pasiekiamus „Wi-Fi“ tinklus. Jei įrašyti tinklai neturi interneto ryšio, automatinio prisijungimo funkcija pristabdoma;
4) jungiantis prie tam tikrų nemokamų „Wi-Fi“ interneto prieigos taškų, aptinkamas ir įvertinamas SMS patvirtinimo žinute gautas patvirtinimo kodas ir naudojantis naršykle automatiškai prisijungiama prie tinklo (šiuo metu funkcija veikia tik Kinijoje)."
